import React, { useState, useEffect } from 'react';

import Bounce from 'react-reveal/Bounce';
import Fade from 'react-reveal/Fade';
import Roll from 'react-reveal/Roll';
import Zoom from 'react-reveal/Zoom';
import LightSpeed from "react-reveal/LightSpeed";

import { Dropdown, Divider, Header, Icon, Image } from 'semantic-ui-react'

import Footer from '../Footer';

import "../css/Portfolio.css";
import '../../App.css';

import profilepic from "../images/profile-140x140.png";
import resumepic from "../images/resume.jpg";


const Portfolio = () => {
	return (
  		<>
  			<PortfolioHead />
  			<Footer />
  		</>
	);
}

const PortfolioHead = () => {
	const [showSkills, setShowSkills] = useState(false);
	return(
		<>
			<div className="topbox">
				<Divider horizontal>
					<Header as='h2'>
						<div>
							<span><Icon name='angle double left' /></span>
							<span>Gregory Strydom </span>
							<span><Icon name='angle double right' /></span>
						</div>
					</Header>
				</Divider>
			</div>

			<section className="headingcontainer">
				<div className="leftbox">
					<Fade left>
						<Header as="h3">Web Developer</Header>
					</Fade>
						
					<Zoom>
						<Image src={profilepic} alt="Profile Image" size="small" />
					</Zoom>
				</div>

				<div className="rightbox">
					<Bounce top>
						<Header as="h1">About Me</Header>
					</Bounce>

					<p>
						I have over 10 years of experience as a software engineer, and have worked at both small startups and 
						large organizations. While I'm a proficient front-end developer, my expertise is in building scalable
						backend services.  I love creating things and researching new ideas and technologies. While software 
						engineering problems are often intrinsically fun to tackle, I'm most attracted to solving real customer
						problems with a business justification.
					</p>
				</div>
			</section>

			<section className="buttonSection">
				<Divider horizontal>
					<Header as='h1'>
						<div className="showSkillText">
							<span onClick={() => setShowSkills(!showSkills)}>Show Skills</span><br />
						</div>
					</Header>
				</Divider>
				{showSkills && <PortfolioSkills />}
			</section>
		</>
	)
}

const SkillInfo = (props) => {
	if(props.skillId == "1") {
		return (<h1>Javascript</h1>);
	}
}

const PortfolioSkills = () => {
	const [showResume, setShowResume] = useState(false);
	// const [buttonName, setButtonName] = useState(false);

	const [size, setSize] = useState(window.innerWidth);
	const checkSize = () => {
		setSize(window.innerWidth);
	}

	useEffect(() => {
		window.addEventListener('resize', checkSize);
		return () => {
			window.removeEventListener('resize', checkSize);
		};
	}, []);

	return(
		<>
			<div className="containerBox">
				<section className="skillsBox">
					<Zoom><div className="skill1"><Image size="mini" src="https://e7.pngegg.com/pngimages/780/695/png-clipart-javascript-comment-html-logo-international-conference-on-missions-node-js-icon-angle-text.png" avatar /><span>Javascript</span></div></Zoom>
					<Zoom><div className="skill2"><Image size="mini" src="data:image/png;base64," avatar /><span>HTML/CSS</span></div></Zoom>
					<Zoom><div className="skill3"><Image size="mini" src="https://cdn.iconscout.com/icon/free/png-512/php-27-226042.png" avatar /><span>PHP</span></div></Zoom>
					<Zoom><div className="skill4"><Image size="mini" src="data:image/png;base64," avatar /><span>React</span></div></Zoom>
					<Zoom><div className="skill5"><Image size="mini" src="data:image/jpeg;base64," avatar /><span>Codeigniter</span></div></Zoom>
					<Zoom><div className="skill6"><Image size="mini" src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcT4fqXQCoEUotPc7s3amfc2ob01wwx35ZPT8A&usqp=CAU" avatar /><span>Django</span></div></Zoom>
					<Zoom><div className="skill7"><Image size="mini" src="data:image/jpeg;base64," avatar /><span>Python</span></div></Zoom>
					<Zoom><div className="skill8"><Image size="mini" src="data:image/png;base64," avatar /><span>Photoshop</span></div></Zoom>
					<Zoom><div className="skill9"><Image size="mini" src="data:image/png;base64," avatar /><span>Illustrator</span></div></Zoom>
				</section>
			</div>

			<section className="buttonSection">
				<div>
					<button className="btn-grad" onClick={() => setShowResume(!showResume)}>Show Resume</button>
				</div>
			</section>

			<section className="resumeSection">
				{showResume && <PortfolioResume />}
			</section>
		</>
	)
}


const PortfolioResume = () => {
	return (
		<>
			<section className="resumeBox">
				<Image className="resumePic" size="big" src={resumepic} alt="Gregory Strydom Resume" />
			</section>
		</>
	)
}

export default Portfolio;
